import React from 'react';
import { Form, Input, InputNumber, Select, Button, Upload, message } from 'antd';
import axios from 'axios';

const { Option } = Select;

const RegistrarAjustador = () => {
  const onFinish = async (values) => {
    const formData = new FormData();
    for (const key in values) {
      if (key === 'foto_perfil' && values[key]?.file) {
        formData.append(key, values[key].file.originFileObj);
      } else {
        formData.append(key, values[key]);
      }
    }

    try {
      const response = await axios.post('/Ajustadores/RegistrarAjustadores', formData, {
        headers: {
          'Content-Type': 'multipart/form-data',
        },
      });
      if (response.status === 200) {
        message.success('Formulario enviado exitosamente');
      } else {
        message.error('Error al enviar el formulario');
      }
    } catch (error) {
      message.error('Error al enviar el formulario');
    }
  };

  return (
    <Form
      name="formulario"
      layout="vertical"
      onFinish={onFinish}
    >
      <Form.Item
        label="Nombres"
        name="Nombres"
        rules={[{ required: true, message: 'Por favor ingrese sus nombres' }]}
      >
        <Input />
      </Form.Item>

      <Form.Item
        label="Apellidos"
        name="Apellidos"
        rules={[{ required: true, message: 'Por favor ingrese sus apellidos' }]}
      >
        <Input />
      </Form.Item>

      <Form.Item
        label="Edad"
        name="Edad"
        rules={[{ required: true, message: 'Por favor ingrese su edad' }]}
      >
        <InputNumber min={0} />
      </Form.Item>

      <Form.Item
        label="Sexo"
        name="Sexo"
        rules={[{ required: true, message: 'Por favor seleccione su sexo' }]}
      >
        <Select placeholder="Seleccione">
          <Option value="masculino">Masculino</Option>
          <Option value="femenino">Femenino</Option>
          <Option value="otro">Otro</Option>
        </Select>
      </Form.Item>

      <Form.Item
        label="Teléfono"
        name="Telefono"
        rules={[{ required: true, message: 'Por favor ingrese su teléfono' }]}
      >
        <Input />
      </Form.Item>

      <Form.Item
        label="Correo Electrónico"
        name="Correo_Electronico"
        rules={[{ required: true, message: 'Por favor ingrese su correo electrónico' }, { type: 'email', message: 'Ingrese un correo electrónico válido' }]}
      >
        <Input />
      </Form.Item>

      <Form.Item
        label="Kilometraje Inicial"
        name="Kilometraje_Inicial"
        rules={[{ required: true, message: 'Por favor ingrese el kilometraje inicial' }]}
      >
        <InputNumber min={0} />
      </Form.Item>

      <Form.Item
        label="Número de Llave"
        name="Numero_De_Llave"
        rules={[{ required: true, message: 'Por favor ingrese el número de llave' }]}
      >
        <Input />
      </Form.Item>

      <Form.Item
        label="Modelo del Vehículo"
        name="Modelo_Vehiculo"
        rules={[{ required: true, message: 'Por favor ingrese el modelo del vehículo' }]}
      >
        <Input />
      </Form.Item>

      <Form.Item
        label="Placa del Vehículo"
        name="Placa_Vehiculo"
        rules={[{ required: true, message: 'Por favor ingrese la placa del vehículo' }]}
      >
        <Input />
      </Form.Item>

      <Form.Item
        label="Modelo del Celular"
        name="Modelo_Celular"
        rules={[{ required: true, message: 'Por favor ingrese el modelo del celular' }]}
      >
        <Input />
      </Form.Item>

      <Form.Item
        label="IMEI"
        name="IMEI"
        rules={[{ required: true, message: 'Por favor ingrese el IMEI' }]}
      >
        <Input />
      </Form.Item>

      <Form.Item
        label="Foto de Perfil"
        name="foto_perfil"
        valuePropName="fileList"
        getValueFromEvent={normFile}
        extra="Suba su foto de perfil"
      >
        <Upload name="foto_perfil" listType="picture" beforeUpload={() => false}>
          <Button icon={<UploadOutlined />}>Subir Foto</Button>
        </Upload>
      </Form.Item>

      <Form.Item>
        <Button
          type="primary"
          htmlType="submit"
        >
          Enviar
        </Button>
      </Form.Item>
    </Form>
  );
};

// Función para normar los archivos subidos
const normFile = (e) => {
  console.log('Upload event:', e);
  if (Array.isArray(e)) {
    return e;
  }
  return e && e.fileList;
};

export default RegistrarAjustador;
